static void lv_lua_event_cb(lv_obj_t * obj, lv_event_t event) {
	// TODO: clean
    if (obj->user_data.cb >= 0)  {
        lua_State *L = obj->user_data.L;
        if (!L) return;

        lua_getglobal(L, "debug");
        lua_getfield(L, -1, "traceback");
        lua_replace(L, -2);
    
        lua_rawgeti(L, LUA_REGISTRYINDEX, obj->user_data.cb);
        lua_rawgeti(L, LUA_REGISTRYINDEX, obj->user_data.param);
        lua_pushinteger(L, event);

        uint8_t argc = 2;
        int pcall_ret;
        if ((pcall_ret = lua_pcall(L, argc, 0, -argc - 2)) != 0) {
            // OSI_LOGE(0, "Error calling callback Lua function: lv_lua_event_cb");
            // lua_pop(L, 1);
            const char *errmsg = lua_tostring(L, -1);
            if (!errmsg)
            {
                errmsg = "(No Lua error message)";
                printf("Unexpected Lua Stack:");
            }
            osiTracePrintf(0, "Lua error code %i: %s", pcall_ret, errmsg);
            lua_pop(L, 2);
        }
    }
}

void gl_obj_set_event_cb(lua_State *L, SWIGLUA_REF obj, SWIGLUA_REF ref) {
    lv_obj_t *arg1 = (lv_obj_t *) 0;

    lua_rawgeti(L, LUA_REGISTRYINDEX, obj.ref);
    if (!SWIG_isptrtype(L, -1))
    {
        luaL_error(L, "type error %d", 331);
    }
    if (!SWIG_IsOK(SWIG_ConvertPtr(L,-1,(void**)&arg1,SWIGTYPE_p__lv_obj_t,0)))
    {
        luaL_error(L, "type error %d", 335);
    }
    arg1->user_data.param = obj.ref;
    arg1->user_data.cb = ref.ref;
    arg1->user_data.L = L;

    lv_obj_set_event_cb(arg1, lv_lua_event_cb);
}

