typedef struct
{
    lua_State *L;
    int cb;
} __input_param_t;



static bool parse_table(lua_State *L, inputData_t *data)
{
    // parse type
    lua_getfield(L, -1, "type");
    data->type = lua_tointeger(L, -1);
    if (data->type != LV_INDEV_TYPE_KEYPAD && data->type != LV_INDEV_TYPE_POINTER)
    {
        osiTracePrintf(0, "%s type error %d", __FUNCTION__, data->type);
        goto err;
    }
    lua_pop(L, 1);

    // parse state
    lua_getfield(L, -1, "state");
    data->state = lua_tointeger(L, -1);
    if (data->state != LV_INDEV_STATE_PR && data->state != LV_INDEV_STATE_REL)
    {
        osiTracePrintf(0, "%s state error %d", __FUNCTION__, data->state);
        goto err;
    }
    lua_pop(L, 1);

    //parse data
    if (data->type == LV_INDEV_TYPE_KEYPAD)
    {
        lua_getfield(L, -1, "key");
        data->data.key = lua_tointeger(L, -1);
        lua_pop(L, 1);
    }
    else
    {
        lua_getfield(L, -1, "point");
        if (!lua_istable(L, -1))
        {
            osiTracePrintf(0, "line %d", 437);
            goto err;
        }
        lua_getfield(L, -1, "x");
        data->data.point.x = lua_tointeger(L, -1);
        lua_pop(L, 1);
        lua_getfield(L, -1, "y");
        data->data.point.y = lua_tointeger(L, -1);
        lua_pop(L, 2);
    }

    return true;
err:
    return false;
}

static inputData_t *__input(void *param)
{
    static inputData_t data = {};
    __input_param_t *p = (__input_param_t *)param;
    lua_State *L = p->L;
    int cb = p->cb;
    assert(L && cb >= 0);

    lua_rawgeti(L, LUA_REGISTRYINDEX, cb);

    if (lua_pcall(L, 0, 1, 0))
    {
        osiTracePrintf(0, "call error");
        lua_pop(L, 1);
        return NULL;
    }

    if (!lua_istable(L, -1))
    {
        lua_pop(L, 1);
        return NULL;
    }

    lua_pushnil(L);  /* Make sure lua_next starts at beginning */
    const char *k, *v;
    while (lua_next(L, -2)) 
    {                                            /* TABLE LOCATED AT -2 IN STACK */
        v = lua_tostring(L, -1);                 /* Value at stacktop */
        lua_pop(L,1);                            /* Remove value */
        k = lua_tostring(L, -1);                 /* Read key at stacktop, */
        osiTracePrintf(0, "key %s value %s", k, v);
        /* leave in place to guide next lua_next() */
        /* Do what you need to with k and v */
    }

    memset(&data, 0, sizeof(inputData_t));
    if (!parse_table(L, &data))
    {
        osiTracePrintf(0, "parse error");
        do { lua_pop(L, lua_gettop(L)); } while(0);
        return NULL;
    }

    do { lua_pop(L, lua_gettop(L)); } while(0);

    return &data;
}

void gl_init(lua_State *L, SWIGLUA_REF ref, SWIGLUA_REF keymap)
{
    static guiCfg_t cfg = {0};
    static __create_param_t param = {};
	static __input_param_t input_param = {};
    extern void (platform_lcd_update) (void *, void *);
    cfg.flush = __flush;
    cfg.thread = osiThreadCurrent();
    param.L = L;
    param.cb = ref.ref;
    cfg.create_param = &param;
    cfg.gui_create = __create;
    cfg.get_spec = __spec;

    lua_rawgeti(L, LUA_REGISTRYINDEX, keymap.ref);
    // if (lua_isnil(L, -1))
    //     assert(0);
	if (lua_isfunction(L, -1))
	{
        input_param.L = L;
        input_param.cb = keymap.ref;
        cfg.input_param = &input_param;
		cfg.input = __input;
	}
    lua_pop(L, 1);
    // lua_settop(L, -2);

    if (!lvGuiInit(&cfg))
    {
        luaL_error(L, "lv_event_loop");
    }
}

