static void lv_lua_anim_exec_cb(void *var, lv_anim_value_t value)
{
    lv_anim_user_data_t *a = (lv_anim_user_data_t *)var;
    lua_State *L = a->L;
    int cb = a->cb;
    int obj = a->var;
    assert(L && cb >= 0 && obj >= 0);

    lua_rawgeti(L, LUA_REGISTRYINDEX, cb);

    lua_rawgeti(L, LUA_REGISTRYINDEX, obj);
    lua_pushinteger(L, value);

    if (lua_pcall(L, 2, 0, 0))
    {
        OSI_LOGE(0, "Error calling callback Lua function: lv_lua_anim_exec_cb");
        lua_pop(L, 1);
    }
}

